# [ repr ( C ) ]
pub struct Memrmp {
    register: ::volatile_register::RW<u32>,
}

impl Memrmp {
    pub fn modify<F>(&mut self, f: F)
        where for<'w> F: FnOnce(&MemrmpR, &'w mut MemrmpW) -> &'w mut MemrmpW
    {
        let bits = self.register.read();
        let r = MemrmpR { bits: bits };
        let mut w = MemrmpW { bits: bits };
        f(&r, &mut w);
        self.register.write(w.bits);
    }
    pub fn read(&self) -> MemrmpR {
        MemrmpR { bits: self.register.read() }
    }
    pub fn write<F>(&mut self, f: F)
        where F: FnOnce(&mut MemrmpW) -> &mut MemrmpW
    {
        let mut w = MemrmpW::reset_value();
        f(&mut w);
        self.register.write(w.bits);
    }
}

# [ derive ( Clone , Copy ) ]
# [ repr ( C ) ]
pub struct MemrmpR {
    bits: u32,
}

impl MemrmpR {
    # [ doc = "Bit 8 - Flash Bank mode selection" ]
    pub fn fb_mode(&self) -> bool {
        const OFFSET: u8 = 8u8;
        self.bits & (1 << OFFSET) != 0
    }
    # [ doc = "Bit 3 - QUADSPI memory mapping swap" ]
    pub fn qfs(&self) -> bool {
        const OFFSET: u8 = 3u8;
        self.bits & (1 << OFFSET) != 0
    }
    # [ doc = "Bits 0:2 - Memory mapping selection" ]
    pub fn mem_mode(&self) -> u8 {
        const MASK: u32 = 7;
        const OFFSET: u8 = 0u8;
        ((self.bits >> OFFSET) & MASK) as u8
    }
}

# [ derive ( Clone , Copy ) ]
# [ repr ( C ) ]
pub struct MemrmpW {
    bits: u32,
}

impl MemrmpW {
    # [ doc = r" Reset value" ]
    pub fn reset_value() -> Self {
        MemrmpW { bits: 0u32 }
    }
    # [ doc = "Bit 8 - Flash Bank mode selection" ]
    pub fn fb_mode(&mut self, value: bool) -> &mut Self {
        const OFFSET: u8 = 8u8;
        if value {
            self.bits |= 1 << OFFSET;
        } else {
            self.bits &= !(1 << OFFSET);
        }
        self
    }
    # [ doc = "Bit 3 - QUADSPI memory mapping swap" ]
    pub fn qfs(&mut self, value: bool) -> &mut Self {
        const OFFSET: u8 = 3u8;
        if value {
            self.bits |= 1 << OFFSET;
        } else {
            self.bits &= !(1 << OFFSET);
        }
        self
    }
    # [ doc = "Bits 0:2 - Memory mapping selection" ]
    pub fn mem_mode(&mut self, value: u8) -> &mut Self {
        const OFFSET: u8 = 0u8;
        const MASK: u8 = 7;
        self.bits &= !((MASK as u32) << OFFSET);
        self.bits |= ((value & MASK) as u32) << OFFSET;
        self
    }
}

