# [ repr ( C ) ]
pub struct Skr {
    register: ::volatile_register::WO<u32>,
}

impl Skr {
    pub fn write<F>(&self, f: F)
        where F: FnOnce(&mut SkrW) -> &mut SkrW
    {
        let mut w = SkrW::reset_value();
        f(&mut w);
        self.register.write(w.bits);
    }
}

# [ derive ( Clone , Copy ) ]
# [ repr ( C ) ]
pub struct SkrR {
    bits: u32,
}

impl SkrR {
    # [ doc = "Bits 0:7 - SRAM2 write protection key for software erase" ]
    pub fn key(&self) -> u8 {
        const MASK: u32 = 255;
        const OFFSET: u8 = 0u8;
        ((self.bits >> OFFSET) & MASK) as u8
    }
}

# [ derive ( Clone , Copy ) ]
# [ repr ( C ) ]
pub struct SkrW {
    bits: u32,
}

impl SkrW {
    # [ doc = r" Reset value" ]
    pub fn reset_value() -> Self {
        SkrW { bits: 0u32 }
    }
    # [ doc = "Bits 0:7 - SRAM2 write protection key for software erase" ]
    pub fn key(&mut self, value: u8) -> &mut Self {
        const OFFSET: u8 = 0u8;
        const MASK: u8 = 255;
        self.bits &= !((MASK as u32) << OFFSET);
        self.bits |= ((value & MASK) as u32) << OFFSET;
        self
    }
}
